import React from "react"
// import ReactDOM from "react-dom"

import petsList from "friendList.js"


function Friend(props) {
    const petRolladex = petsList.map(function (individualPet) {
        return (
            <Pet name={individualPet.pets.name} breed={individualPet.pets.name} />
        )
    })
    return (

        < div >
            <h1>{props.name}</h1>
            <h2>{props.age}</h2>
            <h2>{petRolladex}</h2>
        </div>
    )
}

